import { Link } from "react-router-dom";
import "./styles/menuBar.css";
import cards from "../media/cardss.png";
import video from "../media/play.png";
import tips from "../media/blog.png";
import menus from "../media/menu.png";
const MenuBar = () => {
  const getClassName = (e) => {
    console.log(e.target.getAttribute("icon-name"));
  };
  return (
    <div className="container-menu-bar">
      <div className="container-menus-bar">
        <div className="link-my-menu">
          <Link onClick={getClassName} className="link-element" to="/menu">
            <img
              className="icon-menu-bar"
              icon-name="menu"
              src={menus}
              alt=""
            />
          </Link>
        </div>
        <div className="link-my-menu">
          <Link className="link-element" to="/cards">
            <img
              icon-name="menu"
              className="icon-menu-bar"
              src={cards}
              alt=""
            />
          </Link>
        </div>

        <div className="link-my-menu">
          <Link className="link-element" to="/shorts">
            <img className="icon-menu-bar" src={video} alt="" />
          </Link>
        </div>
        <div className="link-my-menu">
          <Link className="link-element" to="/posts">
            <img icon-name="menu" className="icon-menu-bar" src={tips} alt="" />
          </Link>
        </div>
      </div>
    </div>
  );
};

export default MenuBar;
